import './App.css';
import React, { useEffect } from 'react';
import {io} from 'socket.io-client'

function App() {
    useEffect(() => {
        const socket = io('http://localhost:8080')
        socket.emit('message du client')
        return () => socket.disconnect()
    })
    return (
    <div className="App">
        <button onClick={() => socket.emit}>clique moi</button>
    </div>
)}

export default App;
